import React from "react";
import PercentCalculator from "./PercentCalculator";
import DollarCalculator from "./DollarCalculator"
class Calculators extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        const percentCalcNumber = Number(this.props.percentCalculators.length)
        const dollarCalcNumber = Number(this.props.dollarCalculators.length)
        const percentCalcRender = this.props.percentCalculators.map(() =>
            <div>
                <PercentCalculator
                calcId={percentCalcNumber}/>
            </div>
        )
        const dollarCalcRender = this.props.dollarCalculators.map(() =>
            <div>
                <DollarCalculator
                calcId={dollarCalcNumber}/>
            </div>
        )

        return (
            <div className="tc ph4">
                <h2>3. See your calculators below!</h2>
                <div>
                    {percentCalcRender}
                </div>
                <div>
                    {dollarCalcRender}
                </div>
            </div>
        )
    }
}

export default Calculators;
